import React from 'react';
import styled from 'styled-components';

const StyledHeader = styled.label`
  font-size: 36px;
  color: white;
`;

const StyledContainer = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
`;

export default Home = () => {
  return (
    <StyledContainer>
      <StyledHeader>Tellor Dispute Center</StyledHeader>
      <h1>DISPUTES</h1>
    </StyledContainer>
  );
};
